    <textarea id="file-source" class="col-md-12">/*
Language: Objective-C
Author: Valerii Hiora &lt;valerii.hiora@gmail.com&gt;
Contributors: Angel G. Olloqui &lt;angelgarcia.mail@gmail.com&gt;, Matt Diephouse &lt;matt@diephouse.com&gt;, Andrew Farmer &lt;ahfarmer@gmail.com&gt;, Minh Nguyá»…n &lt;mxn@1ec5.org&gt;
Website: https://developer.apple.com/documentation/objectivec
Category: common
*/

function objectivec(hljs) {
  const API_CLASS = {
    className: &#039;built_in&#039;,
    begin: &#039;\\b(AV|CA|CF|CG|CI|CL|CM|CN|CT|MK|MP|MTK|MTL|NS|SCN|SK|UI|WK|XC)\\w+&#039;
  };
  const IDENTIFIER_RE = /[a-zA-Z@][a-zA-Z0-9_]*/;
  const KWS = [
    &quot;int&quot;,
    &quot;float&quot;,
    &quot;while&quot;,
    &quot;char&quot;,
    &quot;export&quot;,
    &quot;sizeof&quot;,
    &quot;typedef&quot;,
    &quot;const&quot;,
    &quot;struct&quot;,
    &quot;for&quot;,
    &quot;union&quot;,
    &quot;unsigned&quot;,
    &quot;long&quot;,
    &quot;volatile&quot;,
    &quot;static&quot;,
    &quot;bool&quot;,
    &quot;mutable&quot;,
    &quot;if&quot;,
    &quot;do&quot;,
    &quot;return&quot;,
    &quot;goto&quot;,
    &quot;void&quot;,
    &quot;enum&quot;,
    &quot;else&quot;,
    &quot;break&quot;,
    &quot;extern&quot;,
    &quot;asm&quot;,
    &quot;case&quot;,
    &quot;short&quot;,
    &quot;default&quot;,
    &quot;double&quot;,
    &quot;register&quot;,
    &quot;explicit&quot;,
    &quot;signed&quot;,
    &quot;typename&quot;,
    &quot;this&quot;,
    &quot;switch&quot;,
    &quot;continue&quot;,
    &quot;wchar_t&quot;,
    &quot;inline&quot;,
    &quot;readonly&quot;,
    &quot;assign&quot;,
    &quot;readwrite&quot;,
    &quot;self&quot;,
    &quot;@synchronized&quot;,
    &quot;id&quot;,
    &quot;typeof&quot;,
    &quot;nonatomic&quot;,
    &quot;super&quot;,
    &quot;unichar&quot;,
    &quot;IBOutlet&quot;,
    &quot;IBAction&quot;,
    &quot;strong&quot;,
    &quot;weak&quot;,
    &quot;copy&quot;,
    &quot;in&quot;,
    &quot;out&quot;,
    &quot;inout&quot;,
    &quot;bycopy&quot;,
    &quot;byref&quot;,
    &quot;oneway&quot;,
    &quot;__strong&quot;,
    &quot;__weak&quot;,
    &quot;__block&quot;,
    &quot;__autoreleasing&quot;,
    &quot;@private&quot;,
    &quot;@protected&quot;,
    &quot;@public&quot;,
    &quot;@try&quot;,
    &quot;@property&quot;,
    &quot;@end&quot;,
    &quot;@throw&quot;,
    &quot;@catch&quot;,
    &quot;@finally&quot;,
    &quot;@autoreleasepool&quot;,
    &quot;@synthesize&quot;,
    &quot;@dynamic&quot;,
    &quot;@selector&quot;,
    &quot;@optional&quot;,
    &quot;@required&quot;,
    &quot;@encode&quot;,
    &quot;@package&quot;,
    &quot;@import&quot;,
    &quot;@defs&quot;,
    &quot;@compatibility_alias&quot;,
    &quot;__bridge&quot;,
    &quot;__bridge_transfer&quot;,
    &quot;__bridge_retained&quot;,
    &quot;__bridge_retain&quot;,
    &quot;__covariant&quot;,
    &quot;__contravariant&quot;,
    &quot;__kindof&quot;,
    &quot;_Nonnull&quot;,
    &quot;_Nullable&quot;,
    &quot;_Null_unspecified&quot;,
    &quot;__FUNCTION__&quot;,
    &quot;__PRETTY_FUNCTION__&quot;,
    &quot;__attribute__&quot;,
    &quot;getter&quot;,
    &quot;setter&quot;,
    &quot;retain&quot;,
    &quot;unsafe_unretained&quot;,
    &quot;nonnull&quot;,
    &quot;nullable&quot;,
    &quot;null_unspecified&quot;,
    &quot;null_resettable&quot;,
    &quot;class&quot;,
    &quot;instancetype&quot;,
    &quot;NS_DESIGNATED_INITIALIZER&quot;,
    &quot;NS_UNAVAILABLE&quot;,
    &quot;NS_REQUIRES_SUPER&quot;,
    &quot;NS_RETURNS_INNER_POINTER&quot;,
    &quot;NS_INLINE&quot;,
    &quot;NS_AVAILABLE&quot;,
    &quot;NS_DEPRECATED&quot;,
    &quot;NS_ENUM&quot;,
    &quot;NS_OPTIONS&quot;,
    &quot;NS_SWIFT_UNAVAILABLE&quot;,
    &quot;NS_ASSUME_NONNULL_BEGIN&quot;,
    &quot;NS_ASSUME_NONNULL_END&quot;,
    &quot;NS_REFINED_FOR_SWIFT&quot;,
    &quot;NS_SWIFT_NAME&quot;,
    &quot;NS_SWIFT_NOTHROW&quot;,
    &quot;NS_DURING&quot;,
    &quot;NS_HANDLER&quot;,
    &quot;NS_ENDHANDLER&quot;,
    &quot;NS_VALUERETURN&quot;,
    &quot;NS_VOIDRETURN&quot;
  ];
  const LITERALS = [
    &quot;false&quot;,
    &quot;true&quot;,
    &quot;FALSE&quot;,
    &quot;TRUE&quot;,
    &quot;nil&quot;,
    &quot;YES&quot;,
    &quot;NO&quot;,
    &quot;NULL&quot;
  ];
  const BUILT_INS = [
    &quot;BOOL&quot;,
    &quot;dispatch_once_t&quot;,
    &quot;dispatch_queue_t&quot;,
    &quot;dispatch_sync&quot;,
    &quot;dispatch_async&quot;,
    &quot;dispatch_once&quot;
  ];
  const KEYWORDS = {
    $pattern: IDENTIFIER_RE,
    keyword: KWS,
    literal: LITERALS,
    built_in: BUILT_INS
  };
  const CLASS_KEYWORDS = {
    $pattern: IDENTIFIER_RE,
    keyword: [
      &quot;@interface&quot;,
      &quot;@class&quot;,
      &quot;@protocol&quot;,
      &quot;@implementation&quot;
    ]
  };
  return {
    name: &#039;Objective-C&#039;,
    aliases: [
      &#039;mm&#039;,
      &#039;objc&#039;,
      &#039;obj-c&#039;,
      &#039;obj-c++&#039;,
      &#039;objective-c++&#039;
    ],
    keywords: KEYWORDS,
    illegal: &#039;&lt;/&#039;,
    contains: [
      API_CLASS,
      hljs.C_LINE_COMMENT_MODE,
      hljs.C_BLOCK_COMMENT_MODE,
      hljs.C_NUMBER_MODE,
      hljs.QUOTE_STRING_MODE,
      hljs.APOS_STRING_MODE,
      {
        className: &#039;string&#039;,
        variants: [
          {
            begin: &#039;@&quot;&#039;,
            end: &#039;&quot;&#039;,
            illegal: &#039;\\n&#039;,
            contains: [ hljs.BACKSLASH_ESCAPE ]
          }
        ]
      },
      {
        className: &#039;meta&#039;,
        begin: /#\s*[a-z]+\b/,
        end: /$/,
        keywords: {
          keyword:
            &#039;if else elif endif define undef warning error line &#039; +
            &#039;pragma ifdef ifndef include&#039;
        },
        contains: [
          {
            begin: /\\\n/,
            relevance: 0
          },
          hljs.inherit(hljs.QUOTE_STRING_MODE, {
            className: &#039;string&#039;
          }),
          {
            className: &#039;string&#039;,
            begin: /&lt;.*?&gt;/,
            end: /$/,
            illegal: &#039;\\n&#039;
          },
          hljs.C_LINE_COMMENT_MODE,
          hljs.C_BLOCK_COMMENT_MODE
        ]
      },
      {
        className: &#039;class&#039;,
        begin: &#039;(&#039; + CLASS_KEYWORDS.keyword.join(&#039;|&#039;) + &#039;)\\b&#039;,
        end: /(\{|$)/,
        excludeEnd: true,
        keywords: CLASS_KEYWORDS,
        contains: [ hljs.UNDERSCORE_TITLE_MODE ]
      },
      {
        begin: &#039;\\.&#039; + hljs.UNDERSCORE_IDENT_RE,
        relevance: 0
      }
    ]
  };
}

export { objectivec as default };</textarea>
